import React from "react";
import "./Header.scss";
import ticketIcon from "./ticketIcon.svg";
export function Header() {
  return (
    <header className="headerContainer">
      <h1 className="title">EXHIBINECTION</h1>
      <div className="signs">
        <div className="sign">
          <a href="/#">Sign In</a>
        </div>
        <div className="sign">
          <a href="/#">Sign up</a>
        </div>
      </div>
      <div className="cart">
        <img src={ticketIcon} alt="" />
      </div>
    </header>
  );
}
